  false,\n\t\"url\": null,\n\t\"notes\": \"The report includes data on bird/habitat
  relations, breeding biology, and effects of succession and current management practices
  on grassland bird communities in the study area. This data, along with the results
  of other studies, is used to produce a set of general management recommendations
  designed to encourage grassland bird populations in the Northeast, as well as specific
  recommendations for important grasslands at Iroquois and Montezuma National Wildlife
  Refuges.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
